import React, { useEffect, useState } from 'react';
import { fetchTrajectory, fetchAllAuthors, fetchRecommendedAuthors } from '../services/api';
import {
  LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer
} from 'recharts';

function TrajectoryPage() {
  const [author, setAuthor] = useState('');
  const [data, setData] = useState([]);
  const [authorList, setAuthorList] = useState([]);
  const [recommendedAuthors, setRecommendedAuthors] = useState([]);
  const [suggestions, setSuggestions] = useState([]);

  useEffect(() => {
    fetchAllAuthors().then(res => setAuthorList(res.data));
    fetchRecommendedAuthors().then(res => setRecommendedAuthors(res.data));
  }, []);

  const handleInputChange = (e) => {
    const keyword = e.target.value;
    setAuthor(keyword);

    if (keyword.length < 1) {
      setSuggestions([]);
      return;
    }

    const matched = authorList
      .filter(name => name.toLowerCase().includes(keyword.toLowerCase()))
      .slice(0, 10);
    setSuggestions(matched);
  };

  const handleSuggestionClick = (name) => {
    setAuthor(name);
    setSuggestions([]);
    handleSearch(name);
  };

  const handleRecommendClick = (name) => {
    setAuthor(name);
    setSuggestions([]);
    handleSearch(name);
  };

  const handleSearch = (authorName = author) => {
    if (!authorName) return;
    fetchTrajectory(authorName).then(res => {
      setData(res.data);
    }).catch(err => {
      console.error("API error:", err);
      setData([]);
    });
  };

  return (
    <div style={{ padding: '30px' }}>
      <h2>Author Trajectory Visualization</h2>

      {/* 검색창 */}
      <div style={{ marginBottom: '20px', position: 'relative' }}>
        <input
          value={author}
          onChange={handleInputChange}
          placeholder="Enter author name"
          style={{ marginRight: '10px', padding: '8px', width: '300px' }}
        />
        <button onClick={() => handleSearch()} style={{ padding: '8px 20px' }}>Search</button>

        {suggestions.length > 0 && (
          <ul style={{
            position: 'absolute',
            top: '35px',
            background: '#fff',
            border: '1px solid #ddd',
            padding: '5px',
            margin: 0,
            width: '300px',
            zIndex: 10,
            listStyle: 'none',
            maxHeight: '200px',
            overflowY: 'auto',
            borderRadius: '5px',
            boxShadow: '0 2px 5px rgba(0,0,0,0.15)'
          }}>
            {suggestions.map((name, idx) => (
              <li key={idx} style={{ padding: '5px', cursor: 'pointer' }}
                  onClick={() => handleSuggestionClick(name)}>
                {name}
              </li>
            ))}
          </ul>
        )}
      </div>

      {/* 추천 저자 */}
      <div style={{ marginBottom: '30px' }}>
        <h4>Recommended Authors (most active years)</h4>
        {recommendedAuthors.map(name => (
          <button
            key={name}
            onClick={() => handleRecommendClick(name)}
            style={{ marginRight: '10px', marginBottom: '10px', padding: '5px 10px' }}
          >
            {name}
          </button>
        ))}
      </div>

      {data.length === 0 ? (
        <p>No data. Please search an author.</p>
      ) : (
        <div style={{ marginTop: '40px' }}>
          <h3>Trajectory Chart</h3>
          <ResponsiveContainer width="100%" height={400}>
            <LineChart data={data}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="year" />
              <YAxis domain={['auto', 'auto']} />
              <Tooltip formatter={(value) => value.toFixed(5)} />
              <Line type="monotone" dataKey="pagerank" stroke="#007bff" strokeWidth={3} dot={{ r: 5 }} />
            </LineChart>
          </ResponsiveContainer>

          <div style={{ marginTop: '30px' }}>
            <h4>Raw Data</h4>
            <ul>
              {data.map((item, idx) => (
                <li key={idx}>
                  {item.year} - Pagerank: {(item.pagerank ?? 0).toFixed(5)}
                </li>
              ))}
            </ul>
          </div>
        </div>
      )}
    </div>
  );
}

export default TrajectoryPage;
